import React from 'react';
import '../Header/Header.css';
import takashimayaLogo from '../../assets/img/general/logo.png';

function Header (){
    return (
        <header className="header-site">
        <nav className="navbar">
          <div className="container header-item-list">
            <a href="#home-page" className="takashimaya-header-logo">
              <img src={takashimayaLogo} alt="Takashimaya-logo" />
            </a>
            <div className="nav" id="header-navbar">
              <a href="#play-page" >
                <button className="button-menu">playGame</button>
              </a>
              <a href="#game-content" >
                <button className="button-menu">rules</button>
              </a>
              <a ><button className="button-menu">prize</button></a>
              <a ><button className="button-menu">rank</button></a>
              <a > className="button-menu">setting</a>
            </div>
          </div>

        </nav>
      </header>
    );
}
export default Header;
